import React, { Component } from 'react';
import './App.css';
class App extends Component {
	state = {
		stocks: []
	};

	async componentDidMount() {
		const response = await fetch('/api/stocks/tsla');
		const body = await response.json();
		this.setState({ stocks: body });
	}
	async componentDidUpdate(prevProps) {
		if (this.props.ticker !== prevProps.ticker) {
			const response = await fetch('/api/stocks/' + this.state.ticker);
			const body = await response.json();
			this.setState({
				series: [{
					data: body.map(day => ({ x: new Date(day.date), y: [day.open, day.high, day.low, day.close] }))
				}],
				options: this.state.options,
			}
			);
		}
	}
	render() {
		const { stocks } = this.state;
		return (
			<div className="App">
				<div className="App-intro">
					<table>
						<tr>
							<th> Date </th>
							<th> Ticker </th>
							<th> Open </th>
							<th> High </th>
							<th> Low </th>
							<th> Close </th>
							<th> Adjusted Close </th>
							<th> Volume </th>
						</tr>
						{stocks.map(stocks =>
							<tr>
								<td> {stocks.date} </td>
								<td> {stocks.ticker} </td>
								<td> {stocks.open} </td>
								<td> {stocks.high} </td>
								<td> {stocks.low} </td>
								<td> {stocks.close} </td>
								<td> {stocks.adjClose} </td>
								<td> {stocks.volume} </td>
							</tr>
						)}
					</table>
				</div>
			</div>
		);
	}
}

export default App;
